import React, {useState} from 'react';
import {
  createMuiTheme
} from '@material-ui/core/styles';
import './App.css';
import red from '@material-ui/core/colors/red';
import {
  Typography,
  Dialog,
  DialogContent,
  DialogActions,
  DialogTitle,
  Button,
  IconButton
} from '@material-ui/core';
class App extends React.Component{

  readonly theme = createMuiTheme({
    palette: {
      primary: {
        main: red[600]
      },
      background: {
        default: red[100]
      }
    }
  });

  render() {
    const [clicker, setClicker] = useState(false);
    return (
      <div style={{
      backgroundColor: this.theme.palette.background.default,
      minHeight: window.innerHeight
      }}>
      <Dialog open={clicker} onClose={() => setClicker(false)}>
        <DialogTitle>About Me</DialogTitle>
        <DialogContent>
          <Typography variant='body1'>Name: Peter Rothstein</Typography>
          <Typography variant='body1'>Interests: Cyber-Security, Automation</Typography>
          <Typography variant='body1'>Hobbies: Working Out, Basketball, Soccer, Hiking</Typography>
          <Typography variant='body1'>Contact: proth@iastate.edu</Typography>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setClicker(false)}>
            Back
          </Button>
        </DialogActions>
      </Dialog>
      </div>
    );
  }
}

export default App;
